import React from "react";
import { Link, NavLink } from "react-router-dom";
import { useEffect, useState } from "react";
import axios from "axios";

function ComponentHeader() {
  const [productCategory, SetProductCategory] = useState([]);

  useEffect(async () => {
    axios
      .get("http://localhost:5000/product-category")
      .then((product) => {
        SetProductCategory(product.data);
        console.log(product.data);
      })
      .catch((error) => {
        console.log(error);
      });
  });

  console.log(productCategory);

  //  productCategory.map((productCategory)=> {
  //     return (`<li>${productCategory.id} ${productCategory.Category} </li>`)
  //   })

  return (
    <React.Fragment>
      <div>
        {productCategory.map((productCategory) => {
           `<li>${productCategory.id} ${productCategory.Category} </li>`;
        })}
      </div>
      <div className="header__navigation">
        <input type="text" placeholder="search" />
      </div>
      <div className="header__navigation">
        <ul>
          <li>
            <NavLink activeClassName="active" to="/">
              Home
            </NavLink>
          </li>
          <li>
            <NavLink activeClassName="active" to="/about">
              About
            </NavLink>
          </li>
          <li>
            <NavLink activeClassName="active" to="/clients">
              client
            </NavLink>
          </li>
          <li>
            <NavLink activeClassName="active" to="/user-login">
              Login
            </NavLink>
          </li>

          <li>
            <NavLink activeClassName="active" to="/user-register">
              Registration
            </NavLink>
          </li>
        </ul>
      </div>
    </React.Fragment>
  );
}

export default ComponentHeader;
